metadata:
  title: "Ôn tập Kiến thức Genshin - Cơ bản"
  subject: "Genshin Impact"
  grade: 8
  language: "vi"
  author: "Nguyen Huu Hoa"
  created_at: "2025-01-15 08:00:00"

exam:
  description: "Bộ câu hỏi luyện tập kiến thức cơ bản về Genshin Impact"
  duration_minutes: 8
  allow_view_answer: true
  allow_download: true
  start_time: "2024-01-15 08:00:00"
  end_time: "2027-01-30 23:59:59"
  shuffle_questions: true
  shuffle_answers: true

questions:
  # =====================
  # MULTIPLE CHOICE + IMAGE
  # =====================
  - type: multiple_choice
    question:
      text: "Nhân vật trong hình dưới đây là ai?"
      img: ""
    choices:
      A:
        text: "Lumine"
      B:
        text: "Aether"
      C:
        text: "Nahida"
      D:
        text: "Kazuha"
    correct: "D"

  # =====================
  # MULTIPLE CHOICE chỉ text
  # =====================
  - type: multiple_choice
    question:
      text: "Trong Genshin Impact, Mondstadt là quốc gia của nguyên tố nào?"
    choices:
      A:
        text: "Hỏa"
      B:
        text: "Phong"
      C:
        text: "Thủy"
      D:
        text: "Băng"
    correct: "B"

  - type: multiple_choice
    question:
      text: "Vũ khí chính của nhân vật Diluc là gì?"
    choices:
      A:
        text: "Kiếm đơn"
      B:
        text: "Cung"
      C:
        text: "Trọng kiếm"
      D:
        text: "Pháp khí"
    correct: "C"

  # =====================
  # MULTIPLE CHOICE (image choices)
  # =====================
  - type: multiple_choice
    question:
      text: "Hình nào sau đây là biểu tượng nguyên tố Phong?"
    choices:
      A:
        img: ""
      B:
        img: ""
      C:
        img: ""
      D:
        img: ""
    correct: "A"

  # =====================
  # TRUE / FALSE GROUP
  # =====================
  - type: true_false_group
    question:
      text: "Đánh dấu đúng sai về các nhận định sau:"
    items:
      a:
        text: "Paimon là Emergency Food (đùa vui trong cộng đồng)."
        correct: true
      b:
        text: "Inazuma là quốc gia tự do giống Mondstadt."
        correct: false
      c:
        text: "Raiden Shogun sử dụng vũ khí thương."
        correct: true
      d:
        text: "Liyue thuộc nguyên tố Băng."
        correct: false

  # =====================
  # ESSAY / TỰ LUẬN
  # =====================
  - type: essay
    question:
      text: "Hãy mô tả ngắn gọn cốt truyện chính của Genshin Impact và vai trò của Traveler."
    correct_answer: "Traveler bị tách khỏi người thân, lạc vào Teyvat, đồng hành cùng Paimon, khám phá các quốc gia và tìm cách đoàn tụ."
    note: "Chấm tương đối, miễn nội dung hợp lý, nêu được Traveler, hành trình và mục tiêu."
